import requests
import json
import os

def infer(imagebase64, prompt):
    url = 'https://cliphotdog.roboflow.cloud/infer/workflows/roboflow-hjgcq/changemyclothes'
    headers = {
        'Content-Type': 'application/json'
    }
    payload = {
        "api_key": os.getenv("ROBOFLOW_API_KEY"),
        "inputs": {
            "image": {"type": "base64", "value": imagebase64},
            "prompt": prompt
        }
    }
    response = requests.post(url, headers=headers, data=json.dumps(payload))
    if response.status_code == 200:
        r = response.json()
        return r['outputs'][0]['output']['value']
    else:
        return f"Error: {response.status_code}, {response.text}"

if __name__ == "__main__":
    imagebase64 = ""
    prompt = "tropical clothes"
    result_image = infer(imagebase64, prompt)
    print(result_image)
